# Linear regression model
def predict(X, theta):
    return np.dot(X, theta)

# Cost function (Mean Squared Error)
def cost_function(X, y, theta):
    m = len(y)
    predictions = predict(X, theta)
    return (1/(2*m)) * np.sum((predictions - y)**2)

# Gradient Descent
def gradient_descent(X, y, theta, learning_rate, iterations):
    m = len(y)
    cost_history = np.zeros(iterations)

    for it in range(iterations):
        prediction = np.dot(X, theta)
        theta = theta - (1/m) * learning_rate * (X.T.dot((prediction - y)))
        cost_history[it] = cost_function(X, y, theta)

    return theta, cost_history

# Adding a bias term to X
X_b = np.c_[np.ones((len(X), 1)), X]
theta_start = np.random.randn(2, 1)

# Hyperparameters
learning_rate = 0.01
iterations = 1000

theta_final, cost_history = gradient_descent(X_b, y, theta_start, learning_rate, iterations)

# Final parameters
print("Final parameters:", theta_final)

# Plotting the cost history
plt.plot(cost_history)
plt.xlabel('Iteration')
plt.ylabel('Cost')
plt.title('Cost Function Over Iterations')
plt.show()

# Plotting the linear fit
