plt.plot(X, predict(X_b, theta_final), color='red')
plt.xlabel('X')
plt.ylabel('y')
plt.title('Linear Regression Fit')
plt.show()

# Gradient Descent with tracking
def gradient_descent_tracking(X, y, theta, learning_rate, iterations):
    m = len(y)
    cost_history = np.zeros(iterations)
    theta_history = np.zeros(iterations)

    for it in range(iterations):
        prediction = np.dot(X, theta)
        theta = theta - (1/m) * learning_rate * (X.T.dot((prediction - y)))
        theta_history[it] = theta[1]
        cost_history[it] = cost_function(X, y, theta)

    return theta, cost_history, theta_history

# Gradient Descent Execution
theta_final, cost_history, theta_history = gradient_descent_tracking(X_b, y, theta_start, learning_rate, iterations)

# Generating a range of theta values for visualization
theta_values = np.linspace(-10, 15, 100).reshape(-1, 1)
cost_values = [cost_function(X_b, y, np.array([theta_final[0], t]).reshape(-1, 1)) for t in theta_values]

# Plotting the Cost Function Curve
plt.figure(figsize=(10, 6))
plt.plot(theta_values, cost_values, label="Cost Function Curve")
